prompt:
Create a graphic information poster titled "Illustrated Guide to Contemporary Chinese Novelists", using a flat illustration + infographic style. The overall layout is divided into {argument name="number of columns" default="6"} sections, each featuring a representative contemporary Chinese novelist.
Each section includes:
- A stylized, non-photorealistic, simplified illustration portrait, but the illustration portrait needs to be based on a real photograph to maintain similarity
- Author's name (Chinese)
- Representative works ({argument name="number of works" default="1-2"})
- Style tags (e.g., {argument name="style tag examples" default="realism, avant-garde literature, youth literature, historical narrative, magical realism, science fiction"})
- A one-sentence brief introduction (very short)
The overall design uses a light background + partitioned color blocks, with a neat and orderly layout.
The six novelists are:
- {argument name="novelist 1" default="Jia Pingwa"}
- {argument name="novelist 2" default="Yu Hua"}
- {argument name="novelist 3" default="Wang Anyi"}
- {argument name="novelist 4" default="Liu Cixin"}
- {argument name="novelist 5" default="Su Tong"}
- {argument name="novelist 6" default="Han Shaogong"}
The main title is "Illustrated Guide to Contemporary Chinese Novelists", with a concise and modern style, suitable for a literary popular science poster.
